import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Cell extends React.Component {
  render() {
    return (
      <button className="cell">
        {/* TODO */}
      </button>
    );
  }
}


class Board extends React.Component {
  renderCell(i) {
    return <Cell />;
  }

  render() {
    const status = 'you have # words left';
    const alphabet = "abcdefghijklmnopqrstuvwxyz"

    const randomCharacter = alphabet[Math.floor(Math.random() * alphabet.length)]

    return (
      <div>
        <div className="status">{status}</div>
        <div className="board-row">
          {this.renderCell(0)}{randomCharacter}
          {this.renderCell(1)}{randomCharacter}
          {this.renderCell(2)}{randomCharacter}
          {this.renderCell(3)}
          {this.renderCell(4)}
          {this.renderCell(5)}
          {this.renderCell(6)}

        </div>
        <div className="board-row">
          {this.renderCell(7)}
          {this.renderCell(8)}
          {this.renderCell(9)}
          {this.renderCell(10)}
          {this.renderCell(11)}
          {this.renderCell(12)}
          {this.renderCell(13)}

        </div>
        <div className="board-row">
          {this.renderCell(14)}
          {this.renderCell(15)}
          {this.renderCell(16)}
          {this.renderCell(17)}
          {this.renderCell(18)}
          {this.renderCell(19)}
          {this.renderCell(20)}
        </div>  
        <div className="board-row">
          {this.renderCell(21)}
          {this.renderCell(22)}
          {this.renderCell(23)}
          {this.renderCell(24)}
          {this.renderCell(25)}
          {this.renderCell(26)}
          {this.renderCell(27)}
        </div>
        <div className="board-row">
          {this.renderCell(28)}
          {this.renderCell(29)}
          {this.renderCell(30)}
          {this.renderCell(31)}
          {this.renderCell(32)}
          {this.renderCell(33)}
          {this.renderCell(34)}
        </div>
        <div className="board-row">
          {this.renderCell(35)}
          {this.renderCell(36)}
          {this.renderCell(37)}
          {this.renderCell(38)}
          {this.renderCell(39)}
          {this.renderCell(40)}
          {this.renderCell(41)}
        </div>
      </div>
    );
  }
}

class WordSearch extends React.Component {
  render() {
    return (
      <div className="game">
        <div className="game-board">
          <Board />
        </div>
        <div className="game-info">
          <div>{/* status */}</div>
          <ol>{/* TODO */}</ol>
        </div>
      </div>
    );
  }
}

